// Routes.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes, } from 'react-router-dom';
import Product from './product';
import App from './App';

const AppRoutes = () => {
  return (
      <Routes>
        <Route path="/" element={<Product />} />
        <Route path="/app" element={<App />} />
      </Routes>
  );
};

export default AppRoutes;
